import './App.css';
import Navbar from './Components/Navbar.js';
import Home from './Components/Home.js';
import { Route, Router, Routes } from 'react-router-dom';
function App() {
  return (
  <>
  <Router>
<Route>

  <Routes element={<Navbar/>}/>

 <Routes element={<Home/>}/> 

</Route>
  </Router>
  </>
  );
}

export default App;
